var tipuesearch = {"pages": [{'title': 'About', 'text': '40523242 \n github 倉儲 :\xa0 https://github.com/s40523242/cp2019 \n Dartpad :\xa0 https://dartpad.dev?id=0964e616f22e783f0fbc560abbc7c034 \n github gist :\xa0 https://gist.github.com/s40523242/0964e616f22e783f0fbc560abbc7c034 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'W3', 'text': '利用Dartpad 引入 Gist 中的 Dart 程式 \n \n 1.在 gist 新增 dart\xa0 程式 \n \n 2. 在自己的網誌上加入這段程式碼， id = gistid\xa0 指定 Gist 檔案的對應 id \n \n \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'w5', 'text': '\n \n \n \n', 'tags': '', 'url': 'w5.html'}, {'title': 'W6', 'text': '\n 程式碼位於:\xa0 https://github.com/40523242/cp2019/downloads/dart_ex/hello \n main(){\n    print("hello");\n} \n Hello 程式 \n \n 程式碼位於:\xa0 https://github.com/40523242/cp2019/downloads/dart_ex/for \n int i;\nint sum;\n \nmain(){\n  sum = 0;\n  for(i=1;i <= 10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n} \n For loop 程式: \n \n \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '\n \n \n  取 Dart 程式的按鈕  \n 放大   回復   Hello   For Loop  內建放入的 Dart 原始碼  \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W11', 'text': '\n \n \n  取 Dart 程式的按鈕  \n 純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W13', 'text': '\n 溫度轉換範例 \n \n  取 Dart 程式的按鈕  \n 純 Dart 程式 \n Temp 1 \n Html 程式 \n Temp 2   Python \n Flutter 程式 \n 溫度轉換 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '\n  透過 getDart(dirname) 取位於 downloads/dart_ex/ 目錄中 dirname 目錄中的 Dart 程式碼  \n \n  取 Dart 程式的按鈕  \n Html 程式 \n ROC Flag   USA Flag    內建放入的 Dart 原始碼  \n 放大   回復 \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W16 查驗考試', 'text': '', 'tags': '', 'url': 'W16 查驗考試.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};